import React from "react";
import Card from "./Card";
import Array from "./Array";

function ncard(val) {
  return (
    <>
      <Card
        id={Array.id}
        name={Array.name}
        age={Array.age}
        degree={Array.degree}
      />
    </>
  );
}

function App() {
  return Array.map(ncard);
}

export default App;
